script: |
  super -f text -I q5189.spq | sort > q5189.out

inputs:
  - name: q5189.spq
    data: |
      SELECT DISTINCT ( + 0 ) / - cor0.col0 + - 8 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab2

outputs:
  - name: q5189.out
    data: |
      -8
